import React from 'react';
import { View, Text, Button} from 'react-native';

function Test1({navigation, route}) {
    return (
        <View>
            <Text>Test1 </Text>
            <Button title="Click Here" onPress={() => navigation.navigate("Test2", {message: "Hello World"})}></Button>
        </View>
    );
}

export default Test1;
